import React, { Component } from "react";
import { CardDeck, Card } from "react-bootstrap";

export class CastList extends Component {
  render() {
    const { cast } = this.props;
    return (
      <CardDeck>
        {cast.map((cur, i) => {
          return (
            <Card style={{ width: "18rem" }}>
              <Card.Img
                variant="top"
                src={`http://image.tmdb.org/t/p/original/${cur.profile_path}`}
              />
              <Card.Body>
                <Card.Title>{cur.name}</Card.Title>
                <Card.Text>as {cur.character}</Card.Text>
              </Card.Body>
            </Card>
          );
        })}
      </CardDeck>
    );
  }
}

export default CastList;
